import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Home from "./Pages/Home";
import Details from "./Pages/Details";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        <h1></h1>
          <Route path="/" element={<Home />} />
          <Route path="/item" element={<Details />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
